import React from "react";
import { Col, Row, Container } from "../../components/Grid";

class Home extends React.Component {
    
    render() {
        return(
            <Container>
                <Row>
                    <Col>
                        <h1>James</h1>
                    </Col>
                    <Col>
                        <h1>Kariuki</h1>
                    </Col>
                </Row>
            </Container>

        )
    }
}
export default Home;
